import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import "./index.css";
import Sdata from "./Sdata";


function ncard(val){
 return (
  <Card
  sname={va.sname}
  imgSrc={va.imgSrc}
  title={va.title}
  link={va.link}
  rating={va.rating}
/>
 )
}

ReactDOM.render(
  <>
    <h1 className="heading">Netflix Top 10 Series</h1>
    Sdata.map(ncard);
      </>,
  document.getElementById("root")
);
